import React, {
    Component,
    Children
} from 'react';
import {
    array
} from 'prop-types';
import {
    forEachChild
} from 'typescript';
import {
    bugs,
    website,
    server
} from "variables/general.js";

class FetchConnectApi extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Listing: []
        }
    }

    myfunction(resposeData) {
        var objData = JSON.parse(this.state.Listing);

        return 0;
    }
    componentDidMount() {
        fetch('https://www.reddit.com/r/nonbinary.json')
            .then(Listing => {
                if (!Listing.ok) {
                    throw Error("Network request failed")
                }
                return Listing;
            })
            .then(data => data.children.json())
            .then(data =>
                this.setState({
                    Listing: data
                }))
    }

    f_test() {
        if (!this.state.results) {
            const testData = this.state.Listing.data[1];
            testData.foreach(c => console.log(c));
        }
    }
    render() {

        const items = this.state.Listing.map(function (item) {
            return <li > {
                item
            } < /li>;
        });
        if (this.state.requestFailed) return <p > Failed! < /p>
        if (!this.state.results) return <div > {} < /div>
    }
}
export default FetchConnectApi;
